webpackJsonp([0xba8248c04248],{856:function(n,e){n.exports={data:{post:{id:"/Users/thanhchungbui/Desktop/thanhchungbtcblog/content/posts/2018-03-20-itunes-connect-analytics-review/index.md absPath of file >>> MarkdownRemark",html:'<h1>iTunes Connects　アプリアナリティクスについてのメモ</h1>\n<p>はじめて<code class="language-text">iTunes Connects</code>を使う時、<code class="language-text">インプレッション数</code>や<code class="language-text">Appユニット数</code>等色々な馴染みのない言葉が出てきます。\nこの記事はそういった<code class="language-text">iTunes Connects</code>の使い方について調べてきたものです。</p>\n<blockquote>\n<p>あなたがAppstoreでアプリをブラウジングしているとこ面白そうなアプリが目に入った。\nすると、<code class="language-text">インプレッション数</code>が増えられる。\nもうちょっと詳しくみたいなと思ってプレビューをタップして、スクリーンショットのいっぱいある画面が出てきたら、\n<code class="language-text">プロダクトページ数</code>が１と増加される。\n「これぞ」と思い、<code class="language-text">購入</code>ボタンをタップして、アプリをダウンロードしよう。<code class="language-text">Appユニット数</code>が１でカウントする。\nダウンロード完了したら、初めてアプリを起動すると<code class="language-text">インストール数</code>が１とプラスされる。\n使ってしばらく経ってからもう一度使いたく、またアプリ起動すると<code class="language-text">セッション数</code>が増えられる。</p>\n</blockquote>\n<p>こういった情報をよく把握することでマーケティング戦略やユーザーのニーズが分かってきて、より良いアプリを作り出せるに繋がるので\n分析データのそれぞれを掘り下げていきましょう。</p>\n<blockquote>\n<ul>\n<li>まず<code class="language-text">itunes Connect</code>のホームページから<code class="language-text">Appアナリティクス</code>をクリックしましょう。\nダッシュボードを開くと下記のようなグラフはずらっと表示されます。\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/dashboard-76bb7bd80f29ba62ba42ebc18b38499b-69819.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 58.903080390683705%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;"\n        alt="Dash board"\n        title=""\n        src="/static/dashboard-76bb7bd80f29ba62ba42ebc18b38499b-48538.png"\n        srcset="/static/dashboard-76bb7bd80f29ba62ba42ebc18b38499b-bed0f.png 200w,\n/static/dashboard-76bb7bd80f29ba62ba42ebc18b38499b-5fd34.png 400w,\n/static/dashboard-76bb7bd80f29ba62ba42ebc18b38499b-48538.png 800w,\n/static/dashboard-76bb7bd80f29ba62ba42ebc18b38499b-b70ec.png 1200w,\n/static/dashboard-76bb7bd80f29ba62ba42ebc18b38499b-69819.png 1331w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </li>\n</ul>\n</blockquote>\n<h2>1. インプレッション数</h2>\n<blockquote>\n<p>App Store 上でApp が表示された回数です</p>\n</blockquote>\n<p>1秒以上アプリ回覧し、また下記の条件いずれかに満たす場合</p>\n<ul>\n<li>検索結果画面で回覧する。\n→　検索結果の中にあったら、回覧しなくてもカウントされる。例えば、結果に10件があり、画面サイズで8件まで表示し、9と10は画面に表示しないが、カウントされる。</li>\n<li>プロダクトページ回覧する。</li>\n<li>Featured, Explore, Top Charts画面で回覧する</li>\n</ul>\n<h2>2. プロダクトページ数</h2>\n<blockquote>\n<p>iOS 8 または tvOS 9 以降を搭載するデバイス上で、App の App Store ページが閲覧された回数です</p>\n</blockquote>\n<p>これはユーザーがアプリに興味を持つのを表す重要なメトリックスである。（気にいらなければ詳細見る？）\nユーザーが</p>\n<ul>\n<li>AppStoreでアプリプリビューをタップする</li>\n<li>直接URLでアプリ表示\nといった操作で発生する</li>\n</ul>\n<h2>3. App ユニット数</h2>\n<blockquote>\n<p>iOS 8 または tvOS 9 以降を搭載したデバイスからの App 購入です。</p>\n</blockquote>\n<p>ユーザーが「購入」ボタンをタップした際発生する。\n同じAppleIdで複数ダウンロードはカウントされない</p>\n<ul>\n<li>アプリ更新</li>\n<li>同一AppleIdで他のデバイスにアプリダウンロードする</li>\n<li>同一AppleIdで同一デバイスにアプリ再インストールする</li>\n</ul>\n<h2>4. ユーサージ</h2>\n<h3>4.1. インストール数（オプトインのみ）</h3>\n<blockquote>\n<p>App のインストール数と再ダウンロード数の合計です。</p>\n</blockquote>\n<p>説明文通りインストール数の合計である。\n理想的にはインストール数　=　Appユニット数だが、</p>\n<ul>\n<li>ユーザーは診断データ共有に同意しない</li>\n<li>ダウンロードして一度もアプリ起動しない\nの場合は対象外となるのでご注意ください。</li>\n</ul>\n<h3>4.2. セッション数（オプトインのみ）</h3>\n<blockquote>\n<p>App を2秒以上使用した回数です。</p>\n</blockquote>\n<p>2秒以上アプリを使用したら1セッションでカウントする。\n使用してアプリをバクグランドに動かし、また開いて使用したら２セッションで数えられる。</p>\n<h3>4.3. アクティブデバイス（オプトインのみ）</h3>\n<p>セッションが１以上存在するデバイス数</p>\n<h2>5. その他</h2>\n<blockquote>\n<p>クラッシュ：強制終了数\n比較メトリック：ほかのメトリックと比較する\n保存済みビュー：プレセットビュー\nオプトイン：ユーザーが開発者に診断データを共有に同意したこと</p>\n</blockquote>\n<h2>6. FAQ</h2>\n<blockquote>\n<p>Q: ユニット数  > インストール数？\nインストール数はオプトインのみの為ユーザーが同意しないと診断データがないから。</p>\n</blockquote>\n<blockquote>\n<p>Q: App ユニット数 > プロダクトページ?\n必ず<code class="language-text">プロダクトページ</code>を表示してからアプリダウンロード（購入）と考えがちだが\n直接<code class="language-text">インプレッション</code>からダウンロードするという方法もある。</p>\n</blockquote>',fields:{slug:"/2018-03-20-itunes-connect-analytics-review/",prefix:""},frontmatter:{title:"itunes connect analytics",subTitle:"はじめて`iTunes Connects`を使うとデータ分析に関してわからない言葉や各要素の意味等はあるかと思います。まとめてやってきました。",cover:null}},author:{id:"/Users/thanhchungbui/Desktop/thanhchungbtcblog/content/parts/author.md absPath of file >>> MarkdownRemark",html:"<p>My name is <strong>Thanh Chung</strong>, a Web Developer. I love reactjs and javascript stacks but it’s really hard. English is not my first language but this blog is aimed to improve my writing skill.</p>"},footnote:{id:"/Users/thanhchungbui/Desktop/thanhchungbtcblog/content/parts/footnote.md absPath of file >>> MarkdownRemark",html:'<ul>\n<li>this blog is forked from   <a href="https://github.com/greglobinski/gatsby-starter-personal-blog">gatsby-starter-personal-blog-starter-kit</a></li>\n<li>built by <a href="https://www.greglobinski.com">greg lobinski</a></li>\n<li>with <a href="https://www.gatsbyjs.org/">Gatsby</a> &#x26; <a href="https://reactjs.org">React</a></li>\n</ul>'},site:{siteMetadata:{facebook:{appId:"238555440035867"}}}},pathContext:{slug:"/2018-03-20-itunes-connect-analytics-review/"}}}});
